export default function Post() {
  return (
    <div className="post">
      <div className="titlebar">
        <div className="tag">UE</div>
        <div className="title">Title</div>
      </div>
      <div className="body">Content</div>
      <div className="data">Bottom</div>
    </div>
  );
}
